import React from "react";
import "./homepage.css";

const Homepage = () => {
    return (
        <div className="homepage">
            <h1>Homepage</h1>
            <div className="btnWrap">
                <a className="button">Logout</a>
            </div>
        </div>
    )
}

export default Homepage;
